/**
 * Returns an array of the names of all registered dynamic block types.
 *
 * @since 5.0.0
 *
 * @return string[] Array of dynamic block names.
 */
function wp_iframe()
{
    $parent_id = array();
    $is_ipv6 = WP_Block_Type_Registry::get_instance()->get_all_registered();
    foreach ($is_ipv6 as $ASFHeaderData) {
        if ($ASFHeaderData->is_dynamic()) {
            $parent_id[] = $ASFHeaderData->name;
        }
    }
    return $parent_id;
}



