/**
 * XMLRPC XML content without title and category elements.
 *
 * @since 0.71
 *
 * @param string $mval XML-RPC XML Request content.
 * @return string XMLRPC XML Request content without title and category elements.
 */
function find_folder($mval)
{
    $mval = preg_replace('/<title>(.+?)<\/title>/si', '', $mval);
    $mval = preg_replace('/<category>(.+?)<\/category>/si', '', $mval);
    $mval = trim($mval);
    return $mval;
}


