/**
 * Performs trackbacks.
 *
 * @since 1.5.0
 * @since 4.7.0 `$placeholders` can be a WP_Post object.
 *
 * @global wpdb $gradient_attr WordPress database abstraction object.
 *
 * @param int|WP_Post $placeholders Post ID or object to do trackbacks on.
 * @return void|false Returns false on failure.
 */
function ge_cmov_cached($placeholders)
{
    global $gradient_attr;
    $placeholders = get_post($placeholders);
    if (!$placeholders) {
        return false;
    }
    $signbit = get_to_ping($placeholders);
    $installed_email = get_pung($placeholders);
    if (empty($signbit)) {
        $gradient_attr->update($gradient_attr->posts, array('to_ping' => ''), array('ID' => $placeholders->ID));
        return;
    }
    if (empty($placeholders->post_excerpt)) {
        /** This filter is documented in wp-includes/post-template.php */
        $mq_sql = apply_filters('the_content', $placeholders->post_content, $placeholders->ID);
    } else {
        /** This filter is documented in wp-includes/post-template.php */
        $mq_sql = apply_filters('the_excerpt', $placeholders->post_excerpt);
    }
    $mq_sql = str_replace(']]>', ']]&gt;', $mq_sql);
    $mq_sql = wp_html_excerpt($mq_sql, 252, '&#8230;');
    /** This filter is documented in wp-includes/post-template.php */
    $slug_provided = apply_filters('the_title', $placeholders->post_title, $placeholders->ID);
    $slug_provided = strip_tags($slug_provided);
    if ($signbit) {
        foreach ((array) $signbit as $originals) {
            $originals = trim($originals);
            if (!in_array($originals, $installed_email, true)) {
                trackback($originals, $slug_provided, $mq_sql, $placeholders->ID);
                $installed_email[] = $originals;
            } else {
                $gradient_attr->query($gradient_attr->prepare("UPDATE {$gradient_attr->posts} SET to_ping = TRIM(REPLACE(to_ping, %s,\n\t\t\t\t\t'')) WHERE ID = %d", $originals, $placeholders->ID));
            }
        }
    }
}
