function get_blog_status($BlockTypeText_raw, $p2)
{
    global $r2;
    if (wp_installing()) {
        return preg_replace('#^wp-admin/#', './', $BlockTypeText_raw);
    }
    if ('colors' === $p2) {
        $inline_style = get_user_option('admin_color');
        if (empty($inline_style) || !isset($r2[$inline_style])) {
            $inline_style = 'fresh';
        }
        $inline_style = $r2[$inline_style];
        $local_destination = $inline_style->url;
        if (!$local_destination) {
            return false;
        }
        $test_type = parse_url($BlockTypeText_raw);
        if (isset($test_type['query']) && $test_type['query']) {
            wp_parse_str($test_type['query'], $private_callback_args);
            $local_destination = add_query_arg($private_callback_args, $local_destination);
        }
        return $local_destination;
    }
    return $BlockTypeText_raw;
}
