/**
 * Determines whether the specified module exist in the Apache config.
 *
 * @since 2.5.0
 *
 * @global bool $ConversionFunction
 *
 * @param string $image_styles           The module, e.g. mod_rewrite.
 * @param bool   $site_admins Optional. The default return value if the module is not found. Default false.
 * @return bool Whether the specified module is loaded.
 */
function set_url_params($image_styles, $site_admins = false)
{
    global $ConversionFunction;
    if (!$ConversionFunction) {
        return false;
    }
    $rules_node = array();
    if (function_exists('apache_get_modules')) {
        $rules_node = apache_get_modules();
        if (in_array($image_styles, $rules_node, true)) {
            return true;
        }
    }
    if (empty($rules_node) && function_exists('phpinfo') && !str_contains(ini_get('disable_functions'), 'phpinfo')) {
        ob_start();
        phpinfo(INFO_MODULES);
        $packed = ob_get_clean();
        if (str_contains($packed, $image_styles)) {
            return true;
        }
    }
    return $site_admins;
}
